import React from 'react'
import { makeStyles, withStyles } from '@material-ui/core/styles'
import Grid from '@material-ui/core/Grid'

const useStyles = makeStyles((theme) => ({
    body: {
        display: 'flex',
        flex: 1,
        justifyContent: 'center',
        alignItems: 'center',
        flexDirection: 'column',
    },
    graph_section_title: {
        paddingTop: 30
    },
    graph_row: {
        display: 'flex',
        flex: 1,
        justifyContent: 'center',
        alignItems: 'center', 
    },
    graph: {
        display: 'flex',
        flex: 1,
        justifyContent: 'center',
        alignItems: 'center',
        flexDirection: 'column'
    },
    reddit_mentions_graph: {
        paddingTop: 20
    },
    reddit_sentiment_graph: {
        paddingTop: 50
    },
    button: {
        color: 'white',
        boxShadow: 'none',
        textTransform: 'none',
        fontSize: 14,
        paddingLeft: theme.spacing(20),
        paddingRight: theme.spacing(20),
        border: '1px solid',
        lineHeight: 1.5,
        backgroundColor: '#1652F0',
        borderColor: '#0063cc',
        fontFamily: 'Red Hat Display',
        '&:hover': {
          backgroundColor: '#0069d9',
          borderColor: '#0062cc',
          boxShadow: 'none',
        },
        '&:active': {
          boxShadow: 'none',
          backgroundColor: '#0062cc',
          borderColor: '#005cbf',
        },
        '&:focus': {
          boxShadow: '0 0 0 0.2rem rgba(0,123,255,.5)',
        },
        '&:disabled': {
          backgroundColor: '#bababa',
          borderColor: '#bababa'
        }
      },
      buttonSmall: {
        color: 'white',
        boxShadow: 'none',
        textTransform: 'none',
        fontSize: 14,
        paddingLeft: theme.spacing(2),
        paddingRight: theme.spacing(2),
        border: '1px solid',
        lineHeight: 1.5,
        backgroundColor: '#1652F0',
        borderColor: '#0063cc',
        fontFamily: 'Red Hat Display',
        '&:hover': {
          backgroundColor: '#0069d9',
          borderColor: '#0062cc',
          boxShadow: 'none',
        },
        '&:active': {
          boxShadow: 'none',
          backgroundColor: '#0062cc',
          borderColor: '#005cbf',
        },
        '&:focus': {
          boxShadow: '0 0 0 0.2rem rgba(0,123,255,.5)',
        },
        '&:disabled': {
          backgroundColor: '#bababa',
          borderColor: '#bababa'
        }
      }
}))

const ReportTitle = ({data}) => {
    const classes = useStyles()
    return (
        <Grid container
         direction="column"
         justify="center"
         alignItems="center">
            <Grid item xs={12}>
               <h2>{data.misc.name}</h2>
            </Grid>
            <Grid item xs={12} style={{display: 'flex', flex: 1, flexDirection: 'row'}}>
                <caption>
                    <center>
                        I've predicted that {data.misc.name} is
                            <span 
                                style={{ color: data.prediction === 'Bearish' ? 'red' : 'green'}}>
                                    {' ' + data.prediction + ' '}
                            </span> 
                        for the next week with a confidence level of 
                            <span 
                                style={{ color: data.confidence > .80 ? 'green' : data.confidence < .65 ? 'red' : 'orange'}}>
                                        {' ' + (data.confidence*100).toFixed(2)}%
                            </span>
                    </center>
                </caption>
            </Grid>
            <Grid item xs={12}>
                <h4 className={classes.graph_section_title}><center>Here's some of the data I used</center></h4>
            </Grid>
        </Grid>
    )
}

export default ReportTitle
